import React, { useState } from "react";
import axios from "axios";

function ManualEntry() {
  const [transactions, setTransactions] = useState([
    {
      date: "",
      description: "",
      type: "UNK", // or "DEB", "CPT", etc.
      credit: 0,
      debit: 0,
      balance: 0
    }
  ]);

  const addRow = () => {
    setTransactions([
      ...transactions,
      {
        date: "",
        description: "",
        type: "UNK",
        credit: 0,
        debit: 0,
        balance: 0
      }
    ]);
  };

  const handleChange = (index, field, value) => {
    const newTxns = [...transactions];
    newTxns[index][field] = value;
    setTransactions(newTxns);
  };

  const handleAnalyze = async () => {
    try {
      // Post the transactions array to your backend endpoint
      const res = await axios.post("http://localhost:8000/analyze-transactions", transactions);
      console.log("Analysis Result:", res.data);
      // Show result on the page, or set some state
    } catch (error) {
      console.error("Error analyzing transactions:", error);
    }
  };

  return (
    <div className="p-4">
      <h1 className="text-2xl font-bold mb-4">Manual Transactions Entry</h1>
      <table className="min-w-full table-auto mb-4">
        <thead>
          <tr>
            <th className="px-2 py-1 border">Date</th>
            <th className="px-2 py-1 border">Description</th>
            <th className="px-2 py-1 border">Type</th>
            <th className="px-2 py-1 border">Credit</th>
            <th className="px-2 py-1 border">Debit</th>
            <th className="px-2 py-1 border">Balance</th>
          </tr>
        </thead>
        <tbody>
          {transactions.map((txn, idx) => (
            <tr key={idx}>
              <td className="px-2 py-1 border">
                <input
                  className="border p-1 w-full"
                  type="text"
                  value={txn.date}
                  onChange={(e) => handleChange(idx, "date", e.target.value)}
                />
              </td>
              <td className="px-2 py-1 border">
                <input
                  className="border p-1 w-full"
                  type="text"
                  value={txn.description}
                  onChange={(e) => handleChange(idx, "description", e.target.value)}
                />
              </td>
              <td className="px-2 py-1 border">
                <input
                  className="border p-1 w-full"
                  type="text"
                  value={txn.type}
                  onChange={(e) => handleChange(idx, "type", e.target.value)}
                />
              </td>
              <td className="px-2 py-1 border">
                <input
                  className="border p-1 w-full"
                  type="number"
                  step="0.01"
                  value={txn.credit}
                  onChange={(e) => handleChange(idx, "credit", parseFloat(e.target.value || 0))}
                />
              </td>
              <td className="px-2 py-1 border">
                <input
                  className="border p-1 w-full"
                  type="number"
                  step="0.01"
                  value={txn.debit}
                  onChange={(e) => handleChange(idx, "debit", parseFloat(e.target.value || 0))}
                />
              </td>
              <td className="px-2 py-1 border">
                <input
                  className="border p-1 w-full"
                  type="number"
                  step="0.01"
                  value={txn.balance}
                  onChange={(e) => handleChange(idx, "balance", parseFloat(e.target.value || 0))}
                />
              </td>
            </tr>
          ))}
        </tbody>
      </table>
      <button onClick={addRow} className="bg-gray-300 px-4 py-2 mr-4">
        + Add Row
      </button>
      <button onClick={handleAnalyze} className="bg-blue-500 text-white px-4 py-2">
        Analyze
      </button>
    </div>
  );
}

export default ManualEntry;
